import React from 'react';
import './sidebardash.css';
import logo from "../logo.png";
import { Link } from "react-router-dom";
function Sidebar({ isSideMenuVisible, toggleSideMenu }) {
  return (
    <aside style={{ display: isSideMenuVisible ? 'block' : 'none' }}>
      <div className="logo1">
        <img src={logo} alt="Logo" />
        <h3><span className="danger"></span></h3>
      </div>
      <div className="sidebar">
        <a href="#" className="active">
          <span className="material-symbols-sharp">Teachers</span>
        </a>
        <a href="/Modal" className="add-student-link" onClick={(e) => { e.preventDefault(); toggleSideMenu(); }}>
          Add Student
        </a>
        <a href="/Modal" className="add-student-link" onClick={(e) => { e.preventDefault(); toggleSideMenu(); }}>
          Log
        </a>
      </div>
      
    </aside>
  );
}

export default Sidebar;
